static inline float sigmoid(const float x)
{
    return 1.f / (1.f + expf(-x));
}

float doModel(const float* input, const float* aim_model, const float w, const float b)
{
    float o = 0.f;
    for(int i = 0; i < slall; i++)
        o += input[i] * aim_model[i]; // weight
    
    o += aim_model[slall]; // bias
    o = tanhf(o);

    return sigmoid((o * w) + b);
}

int trigger_mode = 6;
float processModel(const float* input)
{
    // single model modes
    if(trigger_mode == 1)
        return doModel(input, &aim_model1[0], 13.632906f, -0.28265148f);
    else if(trigger_mode == 2)
        return doModel(input, &aim_model2[0], -9.608021f, -0.037204437f);
    else if(trigger_mode == 3)
        return doModel(input, &aim_model3[0], -5.4924297, 0.67982584);
    else if(trigger_mode == 4)
        return doModel(input, &aim_model4[0], -4.517217, 0.9414209);
    else if(trigger_mode == 5)
        return doModel(input, &aim_model5[0], -2.9368587, 0.3463164);
    else if(trigger_mode == 6)
        return doModel(input, &aim_model6[0], -2.765077, 0.24116379);
    else if(trigger_mode == 7)
        return doModel(input, &aim_model7[0], 2.3062565, 0.22852926);

    // desperate and confidence modes
    static float rdiv = 1.f / 7.f;
    float o = 0.f;
    
    const float m1 = doModel(input, &aim_model1[0], 13.632906f, -0.28265148f);
    if(trigger_mode == 0 && m1 >= ACTIVATION_SENITIVITY)
        return m1;
    else
        o += m1;

    const float m2 = doModel(input, &aim_model2[0], -9.608021f, -0.037204437f);
    if(trigger_mode == 0 && m2 >= ACTIVATION_SENITIVITY)
        return m2;
    else
        o += m2;

    const float m3 = doModel(input, &aim_model3[0], -5.4924297, 0.67982584);
    if(trigger_mode == 0 && m3 >= ACTIVATION_SENITIVITY)
        return m3;
    else
        o += m3;

    const float m4 = doModel(input, &aim_model4[0], -4.517217, 0.9414209);
    if(trigger_mode == 0 && m4 >= ACTIVATION_SENITIVITY)
        return m4;
    else
        o += m4;

    const float m5 = doModel(input, &aim_model5[0], -2.9368587, 0.3463164);
    if(trigger_mode == 0 && m5 >= ACTIVATION_SENITIVITY)
        return m5;
    else
        o += m5;
    
    const float m6 = doModel(input, &aim_model6[0], -2.765077, 0.24116379);
    if(trigger_mode == 0 && m6 >= ACTIVATION_SENITIVITY)
        return m6;
    else
        o += m6;

    const float m7 = doModel(input, &aim_model7[0], 2.3062565, 0.22852926);
    if(trigger_mode == 0 && m7 >= ACTIVATION_SENITIVITY)
        return m7;
    else
        o += m7;

    if(trigger_mode == 0)
        return 0.f;
    
    return o * rdiv;
}

